import {v1 as uuid} from 'uuid';

const initialState = {
    items : [
        {id: uuid(), name : 'Eggs'},
        {id: uuid(), name : 'Milk'},
        {id: uuid(), name : 'Steak'},
        {id: uuid(), name : 'Water'}
    ]
}
